import React, { Component } from "react";

class LoginSection extends Component {
  constructor(props) {
    super(props);
    this.state = { username: "", password: "", isAutoLoggedIn: "" };
  }
  render() {
    return (
      <div className="LoginSection">
        <h1 className="welcomeTitle">Welcome</h1>
      </div>
    );
  }
}

function authenticateUser(e) {
  if (this.state.username === "Justin") {
    if (this.state.password === "Justin") {
      return alert("Welcome Justin!");
    } else {
      return alert("Invalid Password");
    }
  } else {
    return alert("No Such User");
  }
}

export default class UserInput extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  handleSubmit() {}
  render() {
    return (
      <form onSubmit="#">
        <div className="modal-body">
          <div className="form-body">
            <div className="form-group row">
              <label className="control-label col-md-q">Quote Title</label>
              <div className="col-md-3">
                <input
                  name="quoteTitle"
                  id="quoteTitle"
                  className="form-control"
                  type="text"
                  placeholder="Username"
                />
              </div>
            </div>
          </div>
        </div>
      </form>
    );
  }
}
